import styled from "styled-components";

const HomeTitle = styled.h1`
  font-size: 50px;
  color: ${({ theme }) => theme.colors.primary};
`;

const Home = () => {
  return (
    <div>
      <HomeTitle>Hello world!</HomeTitle>
    </div>
  );
};

export default Home;
